import axios from "axios"
import Config from "../Config";
import { Link } from "react-router-dom";

const RecentPost = ({recentPost}) => {
  return (
    <div className="card">
      <div className="img-wrapper">
        <Link> <img
          src={`${Config.baseUrl}/uploads/blogs/${recentPost.imageUrl}`}
          alt="book"
        /></Link>
      </div>
      <div className="large-headers" style={{ padding: "1rem" }}>
        { recentPost.title }
      </div>
      <div className="control-icons flex" style={{ margin: "1rem" }}>
        <p>14 views</p>
        <p>0 comments</p>
        <p>
          1 <i class="fa-regular fa-heart"></i>
        </p>
      </div>
    </div>
  );
};
export default RecentPost;
